import React, { Component } from 'react'
import { FaCocktail, FaHiking, FaShuttleVan, FaBeer } from 'react-icons/fa';
import Title from './Title';
import { icons } from 'react-icons/lib/cjs';
export default class Services extends Component {
    state = {
        services: [
            {
                icon: <FaCocktail />,
                title: ' Free cocktails',
                info: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Provident harum numquam eum laborum cumque quam aperiam. Incidunt dolorum dolor tempora beatae commodi nisi hic accusantium rerum, laudantium at qui non',

            },
            {
                icon: <FaHiking />,
                title: 'Endless Hiking',
                info: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Provident harum numquam eum laborum cumque quam aperiam. Incidunt dolorum dolor tempora beatae commodi nisi hic accusantium rerum, laudantium at qui non',

            },
            {
                icon: <FaShuttleVan />,
                title: ' Free Shuttle',
                info: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Provident harum numquam eum laborum cumque quam aperiam. Incidunt dolorum dolor tempora beatae commodi nisi hic accusantium rerum, laudantium at qui non',

            },
            {
                icon: <FaBeer />,
                title: 'Strongest Beer',
                info: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Provident harum numquam eum laborum cumque quam aperiam. Incidunt dolorum dolor tempora beatae commodi nisi hic accusantium rerum, laudantium at qui non',

            }
        ]
    }
    render() {
        return (
            <section className="services">

                <Title title="services" />
                <div className="services-center">
                    {
                        this.state.services.map((item, index) => {
                            return <article key={index} className="service">
                                <span>{item.icon}</span>
                                <h6>{item.title}</h6>
                                <p>{item.info}</p>
                            </article>
                        })
                    }
                </div>
            </section>
        )
    }
}
